INSERT INTO `products` VALUES (45,'iPhone Charger, MFi Certified Lightning Cable 5 Pack HOVAMP ','iPhone-Charger,-MFi-Certified-Lightning-Cable-5-Pack','<div>Nylon Woven with Metal Connector Compatible iPhone 11/Pro/Xs Max/X/8/7/Plus/6S/6/SE/5S iPad - Silver&amp;White<br></div>','<div><div>Fast Charge:</div><div>♦High-quality four-core copper wires enhance charging &amp; data transfer speed of the cables.</div><div>♦Our technology ensures a faster charging time while keeping your device completely safe.</div><div>♦Easy to carry, It suits every occasions, home, office, car and so on.</div><div><br></div><div>High Quality Nylon Braided:</div><div>♦Constructed from neither plastics nor Polycarbonate sheathing, but has an especially high tensile nylon shell.</div><div>♦The cable is properly circled by the nylon fiber cloth,which brings superior durability and flexibility as well.</div><div>♦Nylon fabric can resist water in some way, but do not put it in water on purpose.</div><div><br></div><div>Compatibility:</div><div>The premium quality of HOVAMP charging cable ensures complete and fast charging and compatibility with:</div><div>iPhone 11/Pro</div><div>iPhone Xs/Max/XR/X/8/8 Plus</div><div>iPhone 7/ 7 Plus / 6s Plus / 6s / 6 Plus</div><div>iPhone 5s / 5c / 5 / SE</div><div>iPad Pro / iPad Air / Air 2</div><div>iPad mini 2 / mini 3 / mini 4</div><div>iPad 4th gen</div><div>iPod Touch 5th gen / iPod Nano 7th gen and Beats Pill+</div><div><br></div><div>What You Get:</div><div>5Pack Lightning Cables , With full confidence in the product we offer 100% refund for unsatisfactory purchase by any reason.</div><div>We provide a 365-day , worry-free to prove the importance we set on quality. Please be sure to send me message if you have a concern.</div></div><div><br></div>','HOVAMP iPhone Charger 5pack main.png','2020-09-30 16:10:14.000000','2022-06-20 19:09:31.178000',_binary '',_binary '',8,11.99,0,2.4,2.4,0.79,0.4,27,83,0,0),(46,'iPhone Charger Cord 4Pack iPhone Charger Cable','iPhone-Charger-Cord-4Pack-iPhone-Charger-Cable','<div>MFi Certified Lightning Cable Fast iPhone Charging Cord Nylon Braided iPhone Charging Cable Compatible with Phone 11 Pro max/XR max/8/7/6/6s/SE 2020,iPad<br></div>','<div><div>Aioneus 4Pack iPhone Charger Cable with Assorted Lengths (1.5FT/3FT/5FT/6FT)</div><div>More convenient to enjoy data sync &amp; charge anywhere and anytime. Using at home, in the car, in the office or outdoors.</div><div>Assorted lengths cover all your daily charging demands. No need to worry about the distance from your devices when charging.</div><div>Package included:</div><div>1*1.5ft Aioneus iPhone charger cord - Green</div><div>1*3ft Aioneus iPhone charging cord - Red</div><div>1*5ft Aioneus iPhone lightning cable - Orange</div><div>1*6ft Aioneus iPhone charger cable - Blue</div></div>','Aioneus iphone charger cord main.png','2022-04-30 16:04:41.000000','2022-05-30 18:16:14.981000',_binary '',_binary '',10.5,16.99,12,3,2,1,0.3,28,83,0,0),(47,'USB C Cable, XIAE 5Pack (3/3/6/6/10FT) Nylon Braided Fast Charging Cable Aluminum','USB-C-Cable-XIAE-5Pack','<div>Compatible with Samsung Galaxy S10 S9 Note 9 8 S8 Plus,LG V30 V20 G6,Google Pixel,Huawei P30/P20-Black&amp;Blue<br></div>','<div><div>Fast charging speed: Compliant with USB Type C specification version 1.1, 56kilohm, ensuring a maximum charge of 3A. Low-resistance internal pure copper wire ensures a maximum charging speed of up to 3A and transmits data up to 480 Mbits.For ensure the charging speed of your device, please use the original USB C port wall charger, or high quality charger which can support QC 2.0/3.0 fast charging.</div><div>Durable: The durable nylon woven fabric is made of a high-quality aluminum casing that makes the charger cable resistant to oxidation. Excellent resistance to twisting and abrasion.With a tested 10000+ bend lifespan.</div><div>Multiple lengths: 3/3/6/6 / 10ft different lengths can be used on sofas, beds, cars and other places. Perfect for long enough wires to enjoy data synchronization and charging anytime, anywhere, without worrying about taking the cable anywhere.</div><div>Compatibility: Compatible with Samsung Galaxy S10 / S10e / S9 / Note 8/9 / S8 / S8 +, Razer, Google Pixel 2 / Pixel / Nexus 5X / Nexus 6P, LG V30 / V20 / G6 / G5, Sony Xperia XZ, Huawei Honor 9/8, Motorola Moto X4 / Z2, HTC U11 and all USB C compatible phones and tablets.</div><div>Warranty Policy: Each sale includes a 180-day Worry-Free Warranty to demonstrate our commitment to quality. If you have any questions, please feel free to contact us.</div></div>','XIAE USB C Cable main.png','2022-04-30 16:08:34.000000','2022-05-30 18:19:39.113000',_binary '',_binary '',7.25,10.99,9,3,2,1,0.4,29,83,0,0),(48,'Micro USB Cable, 10ft 3 Pack Extra Long Charging Cord','Micro-USB-Cable,-10ft-3-Pack-Extra-Long-Charging-Cord','<div>Nylon Braided High Speed Durable Charging USB Charger Android Cable for Samsung Galaxy S7 Edge S6 S5,LG G4,HTC,Android Phone<br></div>','<div><div>★MICRO USB CABLE CONNECTION: The cables are built with MICRO port, exclusively for the devices that has micro connectors. Please make sure you need a MICRO USB CABLE before the purchase. If not, welcome to inquiry</div><div>★UNIVERSAL COMPATIBILITY: This extra long Micro USB Cable supports some Android cell phone and Android devices.Compatible with for Samsung Galaxy S7 Edge S7 S6 Edge S5 S4,Samsung Tablets Tab,for Xbox One controller, for PS4 Controller, Windows Phone, Huawei Honor 7X 6X,Motorola,LG G4 G3 V10,Google Nexus, Blackberry, Sony, HTC, Nokia, Blackberry, wireless keyboards and more</div><div>★DURABILITY &amp; FLEXIBLE: 10ft 3 pack Micro USB Cable is well made with smooth double - braided Nylon that could protect wire cores and resists kinks. With tested 4000+ bend lifespan, our USB charger cords are still sturdy and strong. The cord is also tangle free and flexible which makes your life more convenient</div><div>★EXTRA LONG &amp; PERFECT FIT: Long Android charging cable are considerate on preparing the cables for where you may stay every day. Workplace,office,home,bedroom,car,the way of the journey, etc. Premium compact, heat-resistant aluminium connector makes it easy and secure to connect your devices</div><div>★DATA SYNC &amp; Hi-SPEED CHARGE: The wide diameter wires and reduced cord resistance enable charging speed up to 2.4A, charging faster than most standard cables, and work better for tablets and quick charge devices. USB 2.0 A Male to Micro B cable supports 480Mbps transmission speed</div></div>','Everyworth Micro USB Cable 3pack.png','2022-04-30 16:14:29.000000','2022-05-30 18:18:41.524000',_binary '',_binary '',7,10.99,9,7.5,4,1,0.3,30,83,0,0),(49,'Samsung Electronics EVO Select 256GB microSDXC UHS-I U3 100MB/s Full HD & 4K UHD Memory Card with Adapter (MB-ME256HA)','Samsung-Electronics-EVO-Select-256GB-microSDXC-UHS-I-U3-100M','<div><ul><li><span style=\"font-size: 1rem;\">Memory Type: SDXC</span></li><li>Hardware Interface: MicroSDXC</li><li>Speed Class: Class 10</li><li>Memory Storage Capacity: 256 GB</li></ul></div>','<div><div>Ideal for Recording 4K UHD Video: Samsung micro SD EVO Select is perfect for high res photos, gaming, music, tablets, laptops, action cameras, DSLR\'s, drones, smartphones (Galaxy S20 5G, S20+ 5G, S20 Ultra 5G, S10, S10+, S10e, S9, S9+, Note9, S8, S8+, Note8, S7, S7 Edge, etc. ), Android devices and more</div><div>Ultra Fast Read Write Speeds: Up to 100MB/S Read and 90MB/S Write Speeds; UHS Speed Class U3 and Speed Class 10 (Performance May Vary Based on Host Device, Interface, Usage Conditions, and Other Factors)</div><div>Built to Last Reliability: Memory Card Is Also Water Proof, Temperature Proof, X Ray Proof and Magnetic Proof</div><div>Extended Compatibility: Includes Full Size Adapter for Use in Cameras, Laptops and Desktop Computers</div><div>10 Year Limited : 10 Year Limited Does Not Extend to Dashcam , CCTV, Surveillance Camera and Other Write Intensive Uses</div></div>','Samsung EVO Select 256GB microSD main.png','2022-04-30 16:19:45.000000','2022-05-31 00:45:37.865000',_binary '',_binary '',27.5,49.99,8,1,0.5,0.6,0.03,10,81,0,0),(50,'SanDisk 128GB Extreme microSDXC UHS-I Memory Card with Adapter - C10, U3, V30, 4K, A2, Micro SD - SDSQXA1-128G-GN6MA','SanDisk-128GB-Extreme-microSDXC-UHS-I-Memory-Card-with-Adapter','<div><ul><li>Memory Type: Micro SD</li><li>Hardware Interface: MicroSDXC</li><li>Memory Storage Capacity: 128 GB</li><li>Read Speed: 160 Megabytes Per Second</li></ul></div>','<div>With the SanDisk Extreme 128GB(1) microSD UHS-I Memory Card get extreme speeds for fast transfer, app performance, and 4K UHD video.(2) Ideal for your Android smartphone, action cameras or drones, this high-performance microSD card handles 4K UHD video recording, Full HD video and high-resolution photos. The super-fast SanDisk Extreme microSDXC memory card reads up to 160MB/s and writes up to 90MB/s. Plus, it’s A2-rated, so you can get fast application performance for an exceptional smartphone experience.(7) | Not all devices support microSD memory card formats. Check with your device manufacturer for more details. | For 128GB-400GB: Up to 160MB/s read speeds, engineered with proprietary technology to reach speeds beyond UHS-I 104MB/s, requires compatible devices capable of reaching such speeds. Up to 90MB/s write speeds. 1MB=1,000,000 bytes. | (1) 1GB=1,000,000,000 bytes. Actual user storage less. | (2) Compatible device required. Full HD (1920x1080) and 4K UHD (3840 x 2160) support may vary based upon host device, file attributes and other factors. | (3) Download and installation required. | (4) Card only. See SanDisk website for additional information and limitations. | (5) UHS Speed Class 3 (U3) designates a performance option designed to support real-time video recording with UHS-enabled host devices. Video Speed Class 30 (V30), sustained video capture rate of 30MB/s, designates a performance option designed to support real-time video recording with UHS-enabled host devices. | (6) Registration required; terms and conditions apply. | (7) For 64GB-400GB: A2 performance is 4000 read IOPS, 2000 write IOPS. Results may vary based on host device, app type and other factors. | (8) Read only; based on internal testing. Results may vary based on host device, file attributions and other factors.<br></div>','SanDisk 128GB main.png','2022-04-30 16:20:14.000000','2022-05-30 18:18:54.558000',_binary '',_binary '',17,24.99,0,1,1,0.5,0.3,5,81,0,0),(51,'SanDisk 32GB Ultra microSDHC UHS-I Memory Card with Adapter - 98MB/s, C10, U1, Full HD, A1, Micro SD Card - SDSQUAR-032G-GN6MA','SanDisk-32GB-Ultra-microSDHC-UHS-I-Memory-Card-with-Adapter','<div><ul><li>Memory Type: Microsdhc</li><li>Hardware Interface: MicroSDHC</li><li>Speed Class: Class 10</li><li>Memory Storage Capacity: 32 GB</li></ul></div>','<div><div>Ideal for Android smartphones and tablets, and MIL cameras</div><div>Capacities up to 512GB (1GB=1,000,000,000 bytes. Actual user storage less.) to store even more hours of Full HD video (Approximations; results and Full HD (1920x1080) video support may vary based on host device, file attributes and other factors.)</div><div>Up to 98MB/s transfer read speed (Based on internal testing; performance may be lower depending on host device, interface, usage conditions and other factors.) lets you move up to 1000 photos in a minute (Based on 4.1GB transfer of photos (avg. file 3.5MB) with USB 3.0 reader. Results may vary based on host device, file attributes and other factors.)</div><div>Load apps faster with A1-rated performance (A1 performance is 1500 read IOPS, 500 write IOPS. Based on internal testing. Results may vary based on host device, app type and other factors.)</div><div>Class 10 for Full HD video recording and playback (Full HD (1920x1080) video support may vary based upon host device, file attributes, and other factors.)</div><div>SanDisk Memory Zone app for easy file management (Download and Installation Required)</div><div>10-year limited manufacturer warranty</div><div>Order with your Alexa enabled device. Just ask \"Alexa, order SanDisk microSD.\"</div></div>','SanDisk Ultra 32GB main.png','2022-04-30 16:25:14.000000','2022-05-30 18:18:59.606000',_binary '',_binary '',7,8.99,6,1,1,0.5,0.04,5,81,0,0),(52,'Samsung PRO Endurance 128GB 100MB/s (U1) MicroSDXC Memory Card with Adapter (MB-MJ128GA/AM)','Samsung-PRO-Endurance-128GB-100MBs','<div><ul><li><span style=\"font-size: 1rem;\">Memory Type: Micro SDXC</span></li><li>Hardware Interface: MicroSDXC</li><li>Memory Storage Capacity: 128 GB</li><li>Write Speed: 30</li></ul></div>','<div><div>DESIGNED FOR VIDEO MONITORING: Samsung MicroSDXC PRO is specifically designed for video monitoring cameras including dash cams, surveillance &amp; security cams, body cams, etc.</div><div>ULTRA-FAST READ WRITE SPEEDS: Up to 100MB/s read and 30MB/s write speeds handles large video files quickly and seamlessly</div><div>HIGHER ENDURANCE: Continuous recording up to 25x longer than speed-focused cards gives you long-lasting, best-in-class endurance up to 43,800 hours of 4K and Full HD (1080p) recording and playback</div><div>BUILT TO LAST RELIABILITY: Shock proof memory card is also water proof, temperature proof, x-ray proof and magnetic proof</div><div>5-YEAR LIMITED WARRANTY: 5-year limited warranty; Warranty for SD adapter is limited to 1 year</div></div>','Samsung PRO 128GB main.png','2022-04-30 16:27:21.000000','2022-05-31 00:45:18.068000',_binary '',_binary '',29.99,39.99,7,1,0.6,0.4,0.2,10,81,4,1),(53,'Lexar High-Performance 633x 512GB microSDXC UHS-I Card with SD Adapter (LSDMI512BBNL633A)','Lexar-High-Performance-633x-512GB-microSDXC-UHS-I-Card-with-SD-Adapter','<div><ul><li>Premium memory solution for smartphones, tablets, or action cameras</li><li>Quickly captures, plays back, and transfers media files, including 1080p full-HD, 3D, and 4K video</li><li>Leverages UHS-I technology for a transfer speed up to 100MB/s</li><li>Includes high-speed, Class 10 card and SD adapter</li><li>Limited lifetime product support for card and one-year limited support for adapter</li><li>Only purchase from a Lexar Authorized Dealer</li></ul></div>','<div>Designed for your smartphone, tablet, or action camera, Lexar High-Performance 633x microSDHC/microSDXC UHS-I cards let you quickly capture, playback, and transfer 1080p Full-HD, 3D, and 4K video, as well as the highest-quality movies, photos, and songs. These high-capacity, Class 10 cards leverage UHS-I technology to deliver high-speed performance—up to 100MB/s. This premium memory solution includes an SD adapter and provides the speed and space you need to capture more adventure on the go.<br></div>','Lexar 512GB main.png','2022-04-30 16:30:54.000000','2022-05-30 18:17:42.424000',_binary '',_binary '',62,79.99,0,1,2,0.5,0.2,31,81,4,1),(107,'Driver MOSFET/IGBT Infineon Tehnologies 1ED020I12F2XUMA1','1ED020I12F2XUMA1','<div><ul><li><span style=\"font-size: 1rem;\"><b>Single channel isolated IGBT Driver for 600V/1200 V IGBTs with a&nbsp;2 A rail-to-rail output</b>.</span></li><li>The device also includes IGBT desaturation protection with FAULT status outputs.&nbsp;</li><li>Two READY status outputs reports if the device is supplied and operates correct</li></ul></div>','<div>The <b>1ED020I12-F2</b> is a galvanic isolated single channel IGBT driver in PG-DSO-16-15 package that provides an\r\noutput current capability of typically 2A.&nbsp;</div><div><br></div><div>All logic pins are 5V CMOS compatible and could be directly connected to a microcontroller.&nbsp;</div><div>The data transfer across galvanic isolation is realized by the integrated Coreless Transformer Technology.\r\nThe 1ED020I12-F2 provides several protection features like IGBT desaturation protection, active Miller clamping\r\nand active shut down.&nbsp;<br></div><div><br></div><div><b>CLAMP Miller Clamping</b>\r\nTies the gate voltage to ground after the IGBT has been switched off at a defined voltage to avoid a parasitic\r\nswitch-on of the IGBT.During turn-off, the gate voltage is monitored and the clamp output is activated when the\r\ngate voltage goes below 2 V below VEE2.<br></div><div><br></div><div>Full specs:&nbsp;<a href=\"https://www.tme.eu/Document/f9fc2e39c8ef5fab6fbab91b1d876169/1ED020I12-F2.pdf\" target=\"_self\">1ED020I12-F2.pdf</a></div>','1ED020I12F2XUMA1.1.png','2022-05-30 20:40:28.003000','2022-05-30 23:29:12.802000',_binary '',_binary '',4.05,6.42,3.5,3,3,2,0.01,58,59,3,1),(108,'Diodă 10A6 DC COMPONENTS','10A6-DC','<div>GENERAL PURPOSE SILICON RECTIFIER<br></div><div><br></div><div>CURRENT - 10 Amperes<br></div>','<div><ul><li><span style=\"font-size: 1rem;\">Low cost&nbsp;</span></li><li><span style=\"font-size: 1rem;\">L</span><span style=\"font-size: 1rem;\">ow leakage&nbsp;</span></li><li>Low forward voltage drop</li><li><span style=\"font-size: 1rem;\">High current capability&nbsp;</span></li><li>High surge current capability</li></ul></div>','10a6.1.png','2022-06-01 15:15:04.240000','2022-06-15 12:53:11.989000',_binary '',_binary '',0.25,0.6,0,1,1,1,0.01,59,48,0,0),(109,'Integrat IC digital 74HCT9046A','74HCT9046A','<div>The 74HCT9046A. This device features reduced input threshold levels to allow interfacing\r\nto TTL logic levels. Inputs also include clamp diodes, this enables the use of current\r\nlimiting resistors to interface inputs to voltages in excess of V<span style=\"font-size:12px;\">CC</span>.&nbsp;<br></div>','<div><div><font color=\"#008000\"><span style=\"font-size: 24px;\"><b>Applications:</b></span></font></div></div><div><font color=\"#008000\"><span style=\"font-size: 24px;\"><b><br></b></span></font></div><ul><li><span style=\"font-size: 1rem;\">FM modulation and demodulation where a small center frequency tolerance is\r\nessential&nbsp;</span></li><li><span style=\"font-size: 1rem;\">Frequency synthesis and multiplication where a low jitter is required (e.g. video\r\npicture-in-picture)&nbsp;</span></li><li><span style=\"font-size: 1rem;\">Frequency discrimination&nbsp;</span></li><li><span style=\"font-size: 1rem;\">Tone decoding&nbsp;</span></li><li><span style=\"font-size: 1rem;\">Data synchronization and conditioning&nbsp;</span></li><li><span style=\"font-size: 1rem;\">Voltage-to-frequency conversion&nbsp;</span></li><li><span style=\"font-size: 1rem;\">Motor-speed control</span></li></ul>','74HCT9046A.1.png','2022-06-01 15:28:40.409000','2022-06-15 12:53:42.438000',_binary '',_binary '',2.8,4.95,2,1,1,1,0.01,60,63,0,0),(110,'Integrat IC 74HC4046ADB,112','74HC4046ADB.112','<div>The 74HC4046A; 74HCT4046A is a high-speed Si-gate CMOS device.&nbsp;</div><div>It is specified in\r\ncompliance with JEDEC standard no 7A<br></div>','<div>The <b>74HC4046A; 74HCT4046A</b> is a <u>phase-locked-loop circuit</u> that comprises a linear\r\nvoltage-controlled oscillator (VCO) and three different phase comparators (PC1, PC2 and\r\nPC3). It has a common signal input amplifier and a common comparator input. The signal input can be directly coupled to a large voltage signal, or indirectly\r\ncoupled (with a series capacitor) to a small voltage signal. A self-bias input circuit keeps\r\nsmall voltage signals within the linear region of the input amplifiers. With a passive\r\nlow-pass filter, the 74HC4046A; 74HCT4046A forms a second-order loop PLL. The\r\nexcellent VCO linearity is achieved by the use of linear op amp techniques.&nbsp;<br></div><div><br></div><div>The input signal can be coupled to the self-biasing amplifier at pin SIG_IN, when the\r\nsignal swing is between the standard HC family input logic levels. Capacitive coupling is\r\nrequired for signals with smaller swings.<br></div><div><br></div><div>Documentation:&nbsp;<a href=\"https://www.tme.eu/Document/f06b3b0f29119b66378e767aaa6e5802/74HC_HCT4046A.pdf\" target=\"_blank\">74HC_HCT4046A.pdf</a></div>','74HC4046ADB.1.png','2022-06-01 18:19:24.267000','2022-06-15 12:53:32.899000',_binary '',_binary '',1.4,2.95,2,1,1,1,0.01,60,60,5,1),(111,'Multiplicator analogic: AD633ARZ ANALOG DEVICES','AD633ARZ','<div>FEATURES&nbsp;</div><div>4-Quadrant Multiplication&nbsp;</div><div>Low Cost 8-Lead Package&nbsp;</div><div>Complete—No External Components Required&nbsp;</div><div>Laser-Trimmed Accuracy and Stability&nbsp;</div><div>Total Error within 2% of FS&nbsp;</div><div>Differential High Impedance X and Y Inputs&nbsp;</div><div>High Impedance Unity-Gain Summing Input&nbsp;</div><div>Laser-Trimmed 10 V Scaling Reference&nbsp;</div><div><br></div><div>APPLICATIONS&nbsp;</div><div>Multiplication, Division, Squaring&nbsp;</div><div>Modulation/Demodulation, Phase Detection&nbsp;</div><div>Voltage Controlled Amplifiers/Attenuators/Filters<br></div>','<div>The <b>AD633</b> is a functionally complete, four-quadrant, analog\r\nmultiplier. It includes high impedance, differential X and Y\r\ninputs and a high impedance summing input (Z). The low\r\nimpedance output voltage is a nominal 10 V full scale provided\r\nby a buried Zener. The AD633 is the first product to offer these\r\nfeatures in modestly priced 8-lead plastic DIP and SOIC packages.&nbsp;</div><div>The AD633 is laser calibrated to a guaranteed total accuracy of\r\n2% of full scale. Nonlinearity for the Y input is typically less\r\nthan 0.1% and noise referred to the output is typically less than\r\n100 µV rms in a 10 Hz to 10 kHz bandwidth. A 1 MHz bandwidth, 20 V/µs slew rate, and the ability to drive capacitive loads\r\nmake the AD633 useful in a wide variety of applications where\r\nsimplicity and cost are key concerns.&nbsp;</div><div>The AD633’s versatility is not compromised by its simplicity.\r\nThe Z-input provides access to the output buffer amplifier,\r\nenabling the user to sum the outputs of two or more multipliers,\r\nincrease the multiplier gain, convert the output voltage to a\r\ncurrent, and configure a variety of applications.&nbsp;</div><div>The AD633 is available in an 8-lead plastic DIP package (N)\r\nand 8-lead SOIC (R). It is specified to operate over the 0°C to\r\n70°C commercial temperature range (J Grade) or the –40°C to\r\n+85°C industrial temperature range (A Grade).<br></div>','AD633.1.png','2022-06-01 18:31:02.715000','2022-06-01 18:31:02.715000',_binary '',_binary '',14.8,27.85,2.5,1,1,1,0.01,61,62,5,1),(112,'Soclu DIP 1-2199298-6 TE CONNECTIVITY','1-2199298-6','<div>DIP 20 pins</div>','<div>Soclu DIP 20 pini cu distanță între rânduri de 7.62 mm</div>','1-2199298-6.1.png','2022-06-15 12:58:05.055000','2022-06-15 12:58:05.055000',_binary '',_binary '',0.64,1.14,0,1,1,1,0.01,62,66,0,0),(113,'Microcontroler ARM XMC1100Q024F0064ABXUMA1 INFINEON TECHNOLOGIES','XMC1100Q024F0064ABXUMA1','<div>XMC1300 AB-Step&nbsp;</div><div><br></div><div>Microcontroller Series\r\nfor Industrial Applications&nbsp;</div><div>XMC1000 Family\r\nARM® Cortex®-M0\r\n32-bit processor core<br></div><div>The XMC1300 devices are members of the XMC1000 Family of microcontrollers based\r\non the ARM Cortex-M0 processor core. The XMC1300 series addresses the real-time\r\ncontrol needs of motor control, digital power conversion. It also features peripherals for\r\nLED Lighting applications.<br></div>','<div>The <b>XMC1300 </b>is a member of the <u>XMC1000 Family of microcontrollers</u>. It is also\r\ncompatible to a certain extent with members of similar families or subfamilies.\r\nEach package is optimized for the device it houses. Therefore, there may be slight\r\ndifferences between packages of the same pin-count but for different device types. In\r\nparticular, the size of the exposed die pad may vary.\r\nIf different device types are considered or planned for an application, it must be ensured\r\nthat the board layout fits all packages under consideration.<br></div><div>• CPU Core&nbsp;</div><div>– High-performance 32-bit ARM Cortex-M0 CPU&nbsp;</div><div>– Most 16-bit Thumb and subset of 32-bit Thumb2 instruction set&nbsp;</div><div>– Single cycle 32-bit hardware multiplier&nbsp;</div><div>– System timer (SysTick) for Operating System support<br></div><div><br></div><div>Specs:&nbsp;<a href=\"https://www.tme.eu/Document/aa512e3235c69932ce92ac85fcbe9f2d/XMC1300-AB-EN.pdf\" target=\"_blank\">https://www.tme.eu/Document/aa512e3235c69932ce92ac85fcbe9f2d/XMC1300-AB-EN.pdf</a></div>','snap00760.png','2022-06-15 13:05:20.580000','2022-06-15 13:06:29.016000',_binary '',_binary '',2.1,3.68,0,1,1,1,0.01,58,61,0,0),(114,'Microcontroler ARM XMC1202T016X0032ABXUMA1 INFINEON TECHNOLOGIES','XMC1202T016X0032ABXUMA1','<div>XMC1300 AB-Step&nbsp;</div><div><br></div><div>Microcontroller Series\r\nfor Industrial Applications&nbsp;</div><div><br></div><div>XMC1000 Family\r\nARM® Cortex®-M0\r\n32-bit processor core<br></div>','<div>The XMC1300 devices are members of the XMC1000 Family of microcontrollers based\r\non the ARM Cortex-M0 processor core. The XMC1300 series addresses the real-time\r\ncontrol needs of motor control, digital power conversion. It also features peripherals for\r\nLED Lighting applications.</div><div><span style=\"font-size: 1rem;\">CPU Core&nbsp;</span></div><div><ul><li>High-performance 32-bit ARM Cortex-M0 CPU&nbsp;</li><li>Most 16-bit Thumb and subset of 32-bit Thumb2 instruction set&nbsp;</li><li>Single cycle 32-bit hardware multiplier&nbsp;</li><li>System timer (SysTick) for Operating System support</li></ul></div><div><br></div>','snap00763.png','2022-06-15 13:17:30.841000','2022-06-15 13:17:59.071000',_binary '',_binary '',24.8,36.5,2,1,1,1,0.01,58,61,0,0),(115,'Sursă tensiune AD581JH ANALOG DEVICES','AD581JH','<div><div>Laser Trimmed to High Accuracy:</div><div>10.000 Volts 5 mV (L and U)</div><div>Trimmed Temperature Coefficient:</div><div>5 ppm/C max, 0C to +70C (L)</div><div>10 ppm/C max, –55C to +125C (U)</div><div>Excellent Long-Term Stability:</div><div>25 ppm/1000 hrs. (Noncumulative)</div><div>Negative 10 Volt Reference Capability</div><div>Low Quiescent Current: 1.0 mA max</div><div>10 mA Current Output Capability</div><div>3-Terminal TO-5 Package</div><div>MIL-STD-883 Compliant Versions Available</div></div>','<div>The AD581 is a three-terminal, temperature compensated,\r\nmonolithic bandgap voltage reference which provides a precise\r\n10.00 volt output from an unregulated input level from 12 to 30\r\nvolts. Laser Wafer Trimming (LWT) is used to trim both the\r\ninitial error at +25°C as well as the temperature coefficient,\r\nwhich results in high precision performance previously available\r\nonly in expensive hybrids or oven-regulated modules. The 5 mV\r\ninitial error tolerance and 5 ppm/°C guaranteed temperature coefficient of the AD581L represent the best performance combination available in a monolithic voltage reference.<br></div><div><br></div><div>The bandgap circuit design used in the AD581 offers several advantages over classical Zener breakdown diode techniques. Most\r\nimportant, no external components are required to achieve full\r\naccuracy and stability of significance to low power systems. In\r\naddition, total supply current to the device, including the output\r\nbuffer amplifier (which can supply up to 10 mA) is typically\r\n750 µA. The long-term stability of the bandgap design is equivalent or superior to selected Zener reference diodes.<br></div>','snap00766.png','2022-06-15 13:27:18.203000','2022-06-15 13:27:18.203000',_binary '',_binary '',24.2,38.4,3,1,1,1,0.01,61,64,0,0),(116,'Sursă tensiune AD584JNZ ANALOG DEVICES','AD584JNZ','<div>Four programmable output voltages\r\n10.000 V, 7.500 V, 5.000 V, and 2.500 V&nbsp;</div><div>Laser-trimmed to high accuracies&nbsp;</div><div>No external components required&nbsp;</div><div>Trimmed temperature coefficient\r\n15 ppm/°C maximum, 0°C to 70°C (AD584K)\r\n15 ppm/°C maximum, −55°C to +125°C (AD584T)&nbsp;</div><div>Zero output strobe terminal provided\r\n2-terminal negative reference: capability (5 V and above)&nbsp;</div><div>Output sources or sinks current\r\nLow quiescent current: 1.0 mA maximum\r\n10 mA current output capability\r\nMIL-STD-883 compliant versions available<br></div>','<div>The AD584 is an 8-terminal precision voltage reference offering\r\npin programmable selection of four popular output voltages:\r\n10.000 V, 7.500 V, 5.000 V and 2.500 V. Other output voltages,\r\nabove, below, or between the four standard outputs, are available by\r\nthe addition of external resistors. The input voltage can vary\r\nbetween 4.5 V and 30 V.</div><div>&nbsp;Laser wafer trimming (LWT) is used to adjust the pin\r\nprogrammable output levels and temperature coefficients,\r\nresulting in the most flexible high precision voltage reference\r\navailable in monolithic form.<br></div><div>In addition to the programmable output voltages, the AD584\r\noffers a unique strobe terminal that permits the device to be\r\nturned on or off. When the AD584 is used as a power supply\r\nreference, the supply can be switched off with a single, low power\r\nsignal. In the off state, the current drained by the AD584 is reduced\r\nto approximately 100 µA. In the on state, the total supply current is\r\ntypically 750 µA, including the output buffer amplifier.<br></div><div>The AD584 is recommended for use as a reference for 8-, 10-,\r\nor 12-bit digital-to-analog converters (DACs) that require an\r\nexternal precision reference. In addition, the device is ideal for\r\nanalog-to-digital converters (ADCs) of up to 14-bit accuracy,\r\neither successive approximation or integrating designs, and in\r\ngeneral, it can offer better performance than that provided by\r\nstandard self-contained references.<br></div><div>Specsheet:&nbsp;<a href=\"https://octopart.com/datasheet/ad584jnz-analog+devices-109747\" target=\"_blank\">https://octopart.com/datasheet/ad584jnz-analog+devices-109747</a></div>','snap00769.png','2022-06-15 14:21:05.245000','2022-06-20 19:09:05.267000',_binary '',_binary '',14.2,24.5,0,1,1,1,0.01,61,64,0,0),(117,'Tranzistor N-MOSFET 10N65 LUGUANG ELECTRONIC','10N65-LUGUANG','<div>10N65 650V N-Channel MOSFET<br></div><div>•&nbsp;<span style=\"font-size: 1rem;\">10A, 650V, RDS(on)=0.63Ω @VGS=10 V&nbsp;</span></div><div>• Low gate charge ( typical 45 nC)&nbsp;</div><div>• Low Crss ( typical 12pF)\r\n10N65\r\n650V N-Channel MOSFET</div><div>• Fast switching&nbsp;</div><div>• 100% avalanche tested&nbsp;&nbsp;</div><div>• Improved dv/dt capability<br></div>','<div>This Power MOSFET is produced by HSDQ using its own advanced planar stripe DMOS\r\ntechnology.This advanced technology has been especially tailored to minimize on-state\r\nresistance,provide superior switching performance,and withstand high energy pulse in the\r\navalanche and commutation mode These devices are well suited for high efficiency\r\nTO-220F Package 2\r\navalanche and commutation mode. These devices are well suited for high efficiency\r\nswitched mode power supplies,active power factor correction based on half bridge topology.<br></div>','snap00777.png','2022-06-15 14:42:39.633000','2022-06-15 14:42:39.633000',_binary '',_binary '',1.1,2.55,2.5,1,1,1,0.01,63,54,0,0),(118,'Tranzistor bipolar 2N1613 CDIL','2N1613-CDIL','<div>Tranzistor bipolar&nbsp;</div><div>Montare THT</div><div><span style=\"color: rgb(46, 53, 59); font-family: Lato, Lato-polyfill, Constantia; font-size: 14px;\">Denumire producător: 2N1613</span></div>','<div>Specificații complete:&nbsp;<a href=\"https://www.tme.eu/Document/cef519520a277f0e15db7b22ed28d01c/2N1613.pdf\" target=\"_blank\">https://www.tme.eu/Document/cef519520a277f0e15db7b22ed28d01c/2N1613.pdf</a></div>','snap00778.png','2022-06-15 18:21:23.253000','2022-06-15 18:21:23.253000',_binary '',_binary '',0.98,2.15,10,1,1,1,0.01,64,55,0,0),(119,'Tranzistor unipolar NTE6402 NTE ELECTRONICS','NTE6402-NTE','<div>The NTE6402 is a 3–terminal silicon planer passivated PNP device available in the standard plastic\r\nlow cost TO98 and TO92 type packages. The terminals are designated as anode, anode gate, and\r\ncathode.<br></div>','<div>This device has been characterized as a Programmable Unijunction Transistor (PUT), offering many\r\nadvantages over conventional unijunction transistors. The designer can select R1 and R2 to program\r\nunijunction characteristics such as intrinsic standoff ratio, Interbase resistance, peak–point emitter\r\ncurrent, and valley–point current to meet his particular needs.\r\nPUT’s are specifically charactrized for long interval timers and other applications requiring low leakage and low peak point current. PUT’s similar types have been characterized.</div><div><b style=\"font-size: 1rem;\"><br></b></div><div><b style=\"font-size: 1rem;\">Applications:&nbsp;</b></div><div><br></div><div>- SCR Trigger&nbsp;</div><div>- Pulse and Timing Circuits <br>- Oscillators&nbsp;</div><div>- Sensing Circuits&nbsp;</div><div>- Sweep Circits<br></div><div><br></div><div>Documentation:&nbsp;&nbsp;<a href=\"https://www.tme.eu/Document/bbcbb7b83cf52628bcaaaa7fda0eb87c/nte6402.pdf\" target=\"_blank\">https://www.tme.eu/Document/bbcbb7b83cf52628bcaaaa7fda0eb87c/nte6402.pdf</a></div>','snap00781.png','2022-06-15 18:27:35.900000','2022-06-15 18:28:43.951000',_binary '',_binary '',3.8,5.85,0,1,1,1,0.01,65,56,0,0),(120,'Triac 2N6071BG LITTELFUSE','2N6071BG-LTL','<div>• Sensitive Gate Triggering\r\nUniquely Compatible\r\nfor Direct Coupling to\r\nTTL, HTL, CMOS and\r\nOperational Amplifier\r\nIntegrated Circuit Logic\r\nFunctions&nbsp;</div><div>• Gate Triggering: 4 Mode -\r\n2N6071A, B; 2N6073A, B;\r\n 2N6075A, B&nbsp;</div><div>• Blocking Voltages to 600 V&nbsp;</div><div>• All Diffused and Glass\r\nPassivated Junctions\r\nfor Greater Parameter\r\nUniformity and Stability&nbsp;</div><div>• Small, Rugged,\r\nThermopad Construction\r\nfor Low Thermal\r\nResistance, High Heat\r\nDissipation and Durability<br></div>','<div>Designed primarily for full-wave AC control applications,\r\nsuch as light dimmers, motor controls, heating controls\r\nand power supplies; or wherever full-wave silicon gate\r\ncontrolled solid-state devices are needed. Triac type\r\nthyristors switch from a blocking to a conducting state for\r\neither polarity of applied anode voltage with positive or\r\nnegative gate triggering.<br></div>','snap00783.png','2022-06-15 18:33:47.113000','2022-06-15 18:33:47.113000',_binary '',_binary '',0.85,2.15,10,1,1,1,0.01,66,57,0,0),(121,'Diac BR100-03LLD x 100 buc DIOTEC SEMICONDUCTOR','BR100-03LLD','<div>The DIAC (diode for alternating current) is a diode that conducts electrical current only after its breakover voltage, VBO, has been reached momentarily. Three four and five layer structures may be used. Behavior is similar to the voltage breakdown of a triac without a gate terminal.<br></div>','<div><div>When breakdown occurs, internal positive feedback (impact ionization or two transistor feedback) ensures that the diode enters a region of negative dynamic resistance, leading to a sharp increase in current through the diode and a decrease in the voltage drop across it (typically full switch-on takes a few hundred nanoseconds to microseconds). The diode remains in conduction until the current through it drops below a value characteristic for the device, called the holding current, IH. Below this threshold, the diode switches back to its high-resistance, non-conducting state. This behavior is bi-directional, meaning typically the same for both directions of current.</div><div><br></div><div>Most DIACs have a three-layer structure with breakover voltage of approximately 30 V and an on voltage of less than 3 V. Their behavior is analogous to the striking and extinction voltages of a neon lamp, but it can be more repeatable and takes place at a lower voltages.</div><div><br></div><div>DIACs have no gate or trigger electrode, unlike some other thyristors that they are commonly used to trigger, such as TRIACs. Some TRIACs, like Quadrac, contain a built-in DIAC in series with the TRIAC\'s gate terminal for this purpose.</div><div><br></div><div>DIACs are also called \"symmetrical trigger diodes\" due to the symmetry of their characteristic curve. Because DIACs are bidirectional devices, their terminals are not labeled as anode and cathode but as A1 and A2 or main terminal MT1 and MT2.</div></div>','snap00789.png','2022-06-20 19:07:34.082000','2022-06-20 19:08:28.291000',_binary '',_binary '',3.25,6.2,5,5,9,9,0.1,67,65,0,0),(122,'Diodă Schottky 12SQ030 x 50buc DC COMPONENTS','12SQ030','<div><b>FEATURES&nbsp;</b></div><div>* Low power loss&nbsp;</div><div>* Low forward voltage&nbsp;</div><div>* High current capability&nbsp;</div><div>* High efficiency&nbsp;</div><div><b><br></b></div><div><b>MECHANICAL DATA&nbsp;</b></div><div><span style=\"font-size: 1rem;\">* Case: Molded plastic&nbsp;</span></div><div><span style=\"font-size: 1rem;\">* Epoxy: UL 94V-0 rate flame retardant&nbsp;</span></div><div><span style=\"font-size: 1rem;\">* Mounting position: Any&nbsp;</span></div><div><span style=\"font-size: 1rem;\">* High surge capability&nbsp;</span></div><div><span style=\"font-size: 1rem;\">* Guard ring for transient protection&nbsp;</span></div><div><span style=\"font-size: 1rem;\">* Weight: 2.08 gram</span><br></div>','<div><div>The<b> Schottky diode</b> (named after the German physicist Walter H. Schottky), also known as Schottky barrier diode or hot-carrier diode, is a semiconductor diode formed by the junction of a semiconductor with a metal. It has a low forward voltage drop and a very fast switching action. The cat\'s-whisker detectors used in the early days of wireless and metal rectifiers used in early power applications can be considered primitive Schottky diodes.</div><div><br></div><div>When sufficient forward voltage is applied, a current flows in the forward direction. A silicon p–n diode has a typical forward voltage of 600–700 mV, while the Schottky\'s forward voltage is 150–450 mV. This lower forward voltage requirement allows higher switching speeds and better system efficiency.</div></div>','snap00793.png','2022-06-22 16:36:19.634000','2022-06-22 19:07:54.496000',_binary '',_binary '',12.4,19.25,0,7,5,6,0.1,59,51,0,0),(123,'Diodă transil 1.5KE100A x 50 buc CDIL','Diodă-transil-1.5KE100A-x-50-buc-CDIL','<div><b>FEATURES</b>:&nbsp;</div><div>1. Peak power dissipation 1500W @10 x 1000 us Pulse&nbsp;</div><div>2. Low profile package&nbsp;</div><div>3. Excellent clamping capability&nbsp;</div><div>4. Glass passivated junction&nbsp;</div><div>5. Fast response time: typically less than 1ps from 0 Volts to BV min&nbsp;</div><div>6. Typical IR less than 1uA when VBR min above 12V&nbsp;</div><div>7. IEC 61000-4-2 ESD 30KV(Air), 30KV(Contact)&nbsp;</div><div>8. ESD protection of data lines in accordance with IEC 61000-4-2&nbsp;</div><div>9. EFT protection of data lines in accordance with IEC 61000-4-4&nbsp;</div><div>10. RoHS compliant<br></div>','<div><div>Following the end of forwarding conduction in a p–n type diode, a reverse current can flow for a short time. The device does not attain its blocking capability until the mobile charge in the junction is depleted.</div><div><br></div><div>The effect can be significant when switching large currents very quickly. A certain amount of \"reverse recovery time\" tr (on the order of tens of nanoseconds to a few microseconds) may be required to remove the reverse recovery charge Qr from the diode. During this recovery time, the diode can actually conduct in the reverse direction. This might give rise to a large current in the reverse direction for a short time while the diode is reverse biased. The magnitude of such a reverse current is determined by the operating circuit (i.e., the series resistance) and the diode is said to be in the storage-phase. In certain real-world cases it is important to consider the losses that are incurred by this non-ideal diode effect. However, when the slew rate of the current is not so severe (e.g. Line frequency) the effect can be safely ignored. For most applications, the effect is also negligible for Schottky diodes.</div><div><br></div><div>The reverse current ceases abruptly when the stored charge is depleted; this abrupt stop is exploited in step recovery diodes for the generation of extremely short pulses.</div></div>','snap00798.png','2022-06-22 19:15:08.141000','2022-06-22 19:15:39.148000',_binary '',_binary '',6.5,9.4,5,8,5,9,0.1,64,50,0,0),(124,'Diodă Zener 1EZ10 x 100 buc. DC COMPONENTS','1EZ10','<div><b>FEATURES&nbsp;</b></div><div>* Voltage Range: 6.2V to 300V&nbsp;</div><div>* Low leakage&nbsp;</div><div>* Low inductance&nbsp;</div><div>* High peak reverse power disspation&nbsp;</div><div>* Glass passivated junction&nbsp;</div><div>* Build-in strain relief</div><div><br></div><div><b>MECHANICAL DATA&nbsp;</b></div><div>* Case: Molded plastic&nbsp;</div><div>* Epoxy: UL 94V-0 rate flame retardant&nbsp;</div><div>* Mounting position: Any&nbsp;</div><div>* Weight: 0.33 gram<br></div>','<div><div>A Zener diode is a special type of diode designed to reliably allow current to flow \"backwards\" when a certain set reverse voltage, known as the Zener voltage, is reached.</div><div><br></div><div>Zener diodes are manufactured with a great variety of Zener voltages and some are even variable. Some Zener diodes have a sharp, highly doped p–n junction with a low Zener voltage, in which case the reverse conduction occurs due to electron quantum tunnelling in the short space between p and n regions − this is known as the Zener effect, after Clarence Zener. Diodes with a higher Zener voltage have a more gradual junction and their mode of operation also involves avalanche breakdown. Both breakdown types are present in Zener diodes with the Zener effect predominating at lower voltages and avalanche breakdown at higher voltages.</div><div><br></div><div>Zener diodes are widely used in electronic equipment of all kinds and are one of the basic building blocks of electronic circuits. They are used to generate low-power stabilized supply rails from a higher voltage and to provide reference voltages for circuits, especially stabilized power supplies. They are also used to protect circuits from overvoltage, especially electrostatic discharge.</div></div>','snap00802.png','2022-06-22 19:22:18.719000','2022-06-22 19:22:18.719000',_binary '',_binary '',3.2,5.5,2,7,6,8,0.1,59,49,0,0),(125,'Modul Peltier ATS-TEC30-33-020 ADVANCED THERMAL SOLUTIONS','ATS-TEC30-33-020','<div><b>FEATURES &amp; BENEFITS</b>&nbsp;</div><div>» Medium to small form factors (10x10 to 50x50 mm)&nbsp;</div><div>» Thin form factor (3.3 to 4.7 mm)&nbsp;</div><div>» Cooling power, Qmax, from 2 to 133W&nbsp;</div><div>» Customizable shapes to suit different applications&nbsp;</div><div><br></div><div><b>APPLICATIONS</b>&nbsp;</div><div>» Thermal management&nbsp;</div><div>» Laboratory testing&nbsp;</div><div>» Laser diode&nbsp;</div><div>» Refrigerators&nbsp;</div><div>» Telecom equipment&nbsp;</div><div>» Biomedical equipment<br></div>','<div>Thermoelectric devices are semiconductor heater or refrigeration units which use the Peltier effect to\r\ncreate a heat flux between the two surfaces of the module. Named after French physicist Athanase\r\nPeltier, the Peltier Effect shows that a temperature differential is created when DC current is applied\r\nacross two dissimilar materials with a P-N junction characteristics. The Peltier Effect is one of the\r\nthree thermoelectric effects, the other two are known as the Seebeck Effect and Thomson Effect.&nbsp;</div><div><br></div><div>The typical thermoelectric module is manufactured using two thin ceramic wafers with a series of P\r\nand N doped bismuth-telluride semiconductor material elements sandwiched between them. The ceramic\r\nmaterial on both sides of the module adds rigidity and the necessary electrical insulation. The N element\r\ntype material has an excess of electrons, while the P element type material has a deficit of electrons.\r\nOne P element and one N element make up a couple junction that creates the thermoelectric effect<br></div>','snap00807.png','2022-06-23 00:23:45.831000','2022-06-23 00:26:12.707000',_binary '',_binary '',19.5,27.4,0,5,5,4,0.05,68,107,0,0),(126,'Inductor toroidal 159P HAMMOND','159P-HAMMOND','<div>• Economical \"open bracket\" - channel mount.&nbsp;</div><div>• Tolerance of 15% on both inductance &amp;\r\nresistance.&nbsp;</div><div>• Inductances measured at rated D.C. current.&nbsp;</div><div>• Minimum 5\" long leads.&nbsp;</div><div>• Units will exhibit less inductance at slightly\r\nhigher currents or more at lower currents.&nbsp;</div><div>• Perfect for high voltage power supply\r\nfiltering.<br></div>','<div><div>Toroidal inductors and transformers are inductors and transformers which use magnetic cores with a toroidal (ring or donut) shape. They are passive electronic components, consisting of a circular ring or donut shaped magnetic core of ferromagnetic material such as laminated iron, iron powder, or ferrite, around which wire is wound.</div><div><br></div><div>Although closed-core inductors and transformers often used cores with a square shape in the past, the use of toroidal-shaped cores has significantly increased because of their superior electrical performance. The advantage of the toroidal shape is that, due to its symmetry, the amount of magnetic flux that escapes outside the core (leakage flux) is low, therefore it is more efficient and thus radiates less electromagnetic interference (EMI).</div><div><br></div><div>Toroidal inductors and transformers are used in a wide range of electronic circuits: power supplies, inverters, and amplifiers, which in turn are used in the vast majority of electrical equipment: TVs, radios, computers, and audio systems.</div></div>','snap00370.png','2022-06-23 18:52:18.438000','2022-06-23 18:52:18.438000',_binary '',_binary '',26.4,38.85,0,12,8,8,1.1,69,80,5,1),(127,'Inductor 05HCP-100K-51 x 10 buc. FASTRON','05HCP-100K-51','<div>An inductor is characterized by its inductance, which is the ratio of the voltage to the rate of change of current. In the International System of Units (SI), the unit of inductance is the henry (H) named for 19th century American scientist&nbsp;<a href=\"https://en.wikipedia.org/wiki/Joseph_Henry\" title=\"Joseph Henry\" style=\"color: rgb(6, 69, 173); background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px;\">Joseph Henry</a>. In the measurement of magnetic circuits, it is equivalent to weber/ampere. Inductors have values that typically range from 1 µH (10−6 H) to 20 H. Many inductors have a magnetic core made of iron or ferrite inside the coil, which serves to increase the magnetic field and thus the inductance.&nbsp;<br></div>','<div><div><a href=\"https://en.wikipedia.org/wiki/Inductor\" target=\"_blank\">Inductors</a> are used extensively in analog circuits and signal processing. Applications range from the use of large inductors in power supplies, which in conjunction with filter capacitors remove ripple which is a multiple of the mains frequency (or the switching frequency for switched-mode power supplies) from the direct current output, to the small inductance of the ferrite bead or torus installed around a cable to prevent radio frequency interference from being transmitted down the wire. Inductors are used as the energy storage device in many switched-mode power supplies to produce DC current. The inductor supplies energy to the circuit to keep current flowing during the \"off\" switching periods and enables topographies where the output voltage is higher than the input voltage.</div><div><br></div><div>A tuned circuit, consisting of an inductor connected to a capacitor, acts as a resonator for oscillating current. Tuned circuits are widely used in radio frequency equipment such as radio transmitters and receivers, as narrow bandpass filters to select a single frequency from a composite signal, and in electronic oscillators to generate sinusoidal signals.</div><div><br></div><div>Two (or more) inductors in proximity that have coupled magnetic flux (mutual inductance) form a transformer, which is a fundamental component of every electric utility power grid. The efficiency of a transformer may decrease as the frequency increases due to eddy currents in the core material and skin effect on the windings. The size of the core can be decreased at higher frequencies. For this reason, aircraft use 400 hertz alternating current rather than the usual 50 or 60 hertz, allowing a great saving in weight from the use of smaller transformers.[12] Transformers enable switched-mode power supplies that isolate the output from the input.</div><div><br></div><div>Inductors are also employed in electrical transmission systems, where they are used to limit switching currents and fault currents. In this field, they are more commonly referred to as reactors.</div><div><br></div><div>Inductors have parasitic effects which cause them to depart from ideal behavior. They create and suffer from electromagnetic interference (EMI). Their physical size prevents them from being integrated on semiconductor chips. So the use of inductors is declining in modern electronic devices, particularly compact portable devices. Real inductors are increasingly being replaced by active circuits such as the gyrator which can synthesize inductance using capacitors.</div></div>','snap00444.png','2022-06-23 19:09:14.679000','2022-07-06 14:33:51.112000',_binary '',_binary '\0',6.7,11.55,5,8,12,6,0.1,70,80,0,0),(128,'Condensator electrolitic SD2A105M05011BB159 x 100 buc. SAMWHA','SD2A105M05011BB159','<div>An electrolytic capacitor is a type of capacitor that uses an electrolyte to achieve a larger capacitance than other capacitor types. An electrolyte is a liquid or gel containing a high concentration of ions. Almost all electrolytic capacitors are polarized, which means that the voltage on the positive terminal must always be greater than the voltage on the negative terminal. The benefit of large capacitance in electrolytic capacitors comes with several drawbacks as well. Among these drawbacks are large leakage currents, value tolerances, equivalent series resistance and a limited lifetime. Electrolytic capacitors can be either wet-electrolyte or solid polymer. They are commonly made of tantalum or aluminum, although other materials may be used. Supercapacitors are a special subtype of electrolytic capacitors, also called double-layer electrolytic capacitors, with capacitances of hundreds and thousands of farads.&nbsp;&nbsp;<br></div>','<div><div>Aluminum electrolytic capacitors are made of two aluminum foils and a paper spacer soaked in electrolyte. One of the two aluminum foils is covered with an oxide layer, and that foil acts as the anode, while the uncoated one acts as a cathode. During normal operation, the anode must be at a positive voltage in relation to the cathode, which is why the cathode is most commonly marked with a minus sign along the body of the capacitor. The anode, electrolyte-soaked paper and cathode are stacked. The stack is rolled, placed into a cylindrical enclosure and connected to the circuit using pins. There are two common geometries: axial and radial. Axial capacitors have one pin on each end of the cylinder, while in the radial geometry, both pins are located on the same end of the cylinder.</div><div><img loading=\"lazy\" src=\"https://eepower.com/uploads/education/electrolytic-capacitor-schematic.png\" alt=\"Schematic Electrolytic Capacitor\" width=\"500\" height=\"388\" class=\"aligncenter size-full wp-image-70\" style=\"box-sizing: inherit; border: 0px solid rgb(192, 192, 201); display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></div><div>Electrolytic capacitors have a larger capacitance than most other capacitor types, typically 1µF to 47mF. There is a special type of electrolytic capacitor, called a double-layer capacitor or a supercapacitor, whose capacitance can reach thousands of farads. The capacitance of an aluminum electrolytic capacitor is determined by several factors, such as the plate area and the thickness of the electrolyte. This means that a large capacitance &nbsp;capacitor is bulky and large in size.</div><div>It is worth mentioning that electrolytic capacitors made using old technology didn\'t have a very long shelf life, typically only a few months. If left unused, the oxide layer deteriorates and has to be rebuilt in a process called capacitor reforming. This can be performed by connecting the capacitor to a voltage source through a resistor and slowly increasing the voltage until the oxide layer has been fully rebuilt. Modern electrolytic capacitors have a shelf life of 2 years or more. If the capacitor is left unpolarized for longer periods, they must be reformed prior to use.</div></div>','snap00378.png','2022-06-25 10:33:00.842000','2022-07-05 15:31:32.792000',_binary '',_binary '',2.85,4.15,0,9,9,14,0.1,71,75,0,0),(129,'Condensator polimeric 100SXE6R8M PANASONIC','100SXE6R8M','<div><div>Polymer Ta-e-caps are available in rectangular surface-mounted device (SMD) chip style. Polymer Al-e-caps and hybrid polymer Al-e-caps are available in rectangular surface-mounted device (SMD) chip style, in cylindrical SMDs (V-chips) style or as radial leaded versions (single-ended).</div><div><br></div><div>Polymer electrolytic capacitors are characterized by particularly low internal equivalent series resistances (ESR) and high ripple current ratings. Their electrical parameters have similar temperature dependence, reliability and service life compared to solid tantalum capacitors, but have a much better temperature dependence and a considerably longer service life than aluminium electrolytic capacitors with non-solid electrolytes. In general polymer e-caps have a higher leakage current rating than the other solid or non-solid electrolytic capacitors.</div></div>','<div><div>Rectangular polymer Al-caps have one or more layered aluminium anode foils and a conductive polymer electrolyte. The layered anode foils are at one side contacted with each other, this block is anodically oxidized to achieve the dielectric, and the block is impregnated with the precursors of the polymer to achieve the polymer electrolyte, the counter electrode. Like for polymer tantalum capacitors this polymerized block now is successively dipped into conducting graphite and then silver to provide a good connection to the conducting polymer. This layers achieves the cathode connection of the capacitor. The capacitive cell then generally is molded by a synthetic resin.</div><div><br></div><div>The layered anode foils in the rectangular shaped polymer Al-chip-e-caps are electrically parallel connected single capacitors. Thus, the ESR and ESL values are connected in parallel reducing ESR and ESL correspondingly, and allowing them to operate at higher frequencies.</div><div><br></div><div>These rectangular polymer Al-chip-e-caps are available in the \"D\"-case with dimensions of 7.3x4.3 mm and heights of between 2 and 4 mm. They provide a competitive alternative to Ta-caps.[50][better source needed]</div><div><br></div><div>Comparing mechanical comparable polymer Al-chip-e-caps and polymer Ta-chip-e-caps shows that the different permittivities of aluminium oxide and tantalum pentoxide have little impact on the specific capacity due to different safety margins in oxide layers. Polymer Ta-e-caps use an oxide layer thickness that corresponds to approximately four times the rated voltage, while the polymer Al-e-caps have about twice the rated voltage.</div></div>','snap00379.png','2022-06-25 10:47:26.997000','2022-06-25 10:50:24.713000',_binary '',_binary '',1.12,1.95,5,1,1,1,0.01,7,76,0,0),(130,'Condensator SMD 02016D105KAT2A x 1000 buc. KYOCERA AVX','02016D105KATA','<div><b><font color=\"#0000ff\">GENERAL DESCRIPTION&nbsp;</font></b></div><div><br></div><div>• General Purpose Dielectric for Ceramic Capacitors&nbsp;</div><div>• EIA Class II Dielectric&nbsp;</div><div>• Temperature variation of capacitance is within ±15%\r\nfrom -55°C to +85°C&nbsp;</div><div>• Well suited for decoupling and filtering applications&nbsp;</div><div>• Available in High Capacitance values (up to 100μF)<br></div>','<div><div>The dielectric films, depending on the desired dielectric strength, are drawn in a special process to an extremely thin thickness, and are then provided with electrodes. The electrodes of film capacitors may be metallized aluminum or zinc applied directly to the surface of the plastic film, or a separate metallic foil. Two of these conductive layers are wound into a cylinder shaped winding, usually flattened to reduce mounting space requirements on a printed circuit board, or layered as multiple single layers stacked together, to form a capacitor body. Film capacitors, together with ceramic capacitors and electrolytic capacitors, are the most common capacitor types for use in electronic equipment, and are used in many AC and DC microelectronics and electronics circuits.[1]</div><div><br></div><div>A related component type is the power (film) capacitor. Although the materials and construction techniques used for large power film capacitors are very similar to those used for ordinary film capacitors, capacitors with high to very high power ratings for applications in power systems and electrical installations are often classified separately, for historical reasons. As modern electronic equipment gained the capacity to handle power levels that were previously the exclusive domain of \"electrical power\" components, the distinction between the \"electronic\" and \"electrical\" power ratings has become less distinct. In the past, the boundary between these two families was approximately at a reactive power of 200 volt-amperes, but modern power electronics can handle increasing power levels.</div></div>','snap00383.png','2022-06-25 11:28:48.808000','2022-06-25 11:32:11.172000',_binary '',_binary '',28.5,36.85,5,9,9,9,0.4,72,74,0,0),(131,'Condensator tantal T110B106K020AT KEMET','T110B106K020AT','<div><b><font color=\"#0000ff\">Features</font></b></div><div>•	 Taped and reeled per EIA Specification RS–296&nbsp;</div><div>•	 Marking per MIL–STD–1285</div><div>•	 Qualified to MIL–PRF–39003 (CSR13 Style)&nbsp;</div><div>•	 <b>Failure rate options</b>: Graded – B, C, D, and G\r\nExponential – M, P, R, and S*&nbsp;</div><div>•	 <b>Capacitance value</b>s: 0.0047 μF to 330 μF&nbsp;</div><div>• <b>Tolerances</b>: ±5%, ±10% and ±20%&nbsp;</div><div>•	 <b>Voltage rating</b>: 6 – 125 VDC&nbsp;</div><div>•	 <b>Operating temperature range</b>: −55°C to +125°C<br></div>','<div>The KEMET standard hermetically sealed T110 Series is\r\ntargeted for use in high humidity environments. These\r\ncapacitors are ruggedly built, designed for miniaturized\r\ncircuitry, and are especially well-suited for coupling, bypass,\r\nfiltering and RC timing circuits. The T110 Series exhibits\r\nexcellent stability as well as extremely low DC leakage\r\ncurrent, dissipation factor, and ESR/impedance over a wide\r\ntemperature and frequency range. Available in standard\r\nEIA capacitance values from 0.0047 µF to 330 µF in ±20%,\r\n±10%, and ±5% tolerances, the T110 Series is now offered in\r\nworking voltages of 6 VDC to 125 VDC and low ESR limits.\r\nHigher CV values in comparable case sizes are available in\r\nthe KEMET T410 Series.&nbsp;<br></div>','snap00388.png','2022-06-25 11:43:33.010000','2022-07-05 12:02:48.629000',_binary '',_binary '',8.25,10.5,2,1,1,1,0.01,73,77,4.66667,3),(132,'Condensator super BCE005R5C224FS BIGCAP','BCE005R5C224FS','<div>Unlike ordinary electrolytic capacitor or battery, the material of positive and negative polarity of super capacitor issame,so theoretically super capacitor has no polarity; the polarities marked on super capacitor are established by\r\nmanufacturers in the production process, when the polarities are used reversely in short-term, it won’t cause substantial\r\ndamage on capacitor, and it can be used normally after adjusting to the right polarities. But if reversely use for a longtime, the life of super capacitor will decay quickly<br></div>','<div>In the process of charging and discharging, super capacitor’s IR drop caused by inner resistance will leads to loseof\r\nefficiency of capacitor charging and discharging, so the size of capacitor determines the quality of capacitor to some extent;\r\ndue to the internal resistance of the super capacitor is higher than normal capacitors, so in the process of charge anddischargeby AC circuit or high frequency circuit, super capacitor will become heating, and this cause life decay quickly, that’s why super capacitor only commonly used in DC circuit.&nbsp;</div><div><br></div><div>Compared with ordinary capacitor, super capacitor has greater time constant τ , so the charge and discharge time is longer; also because of this,it is not suitable for working with continuous large current frequently as it can cause performancedecay rapidly. The frequency characteristic of super capacitor is: the response time of positive and negative ions incarbonelectrode pore is longer, so the capacity appears very small. It is not allowed to measure super capacitor by using equipment\r\nfor testing common capacitors and AC measuring methods, it should be measured by methods for measuring batteryfor mAh.<br></div>','snap00392.png','2022-06-25 11:53:41.721000','2022-06-25 11:55:39.327000',_binary '',_binary '',1.85,2.45,0,1,1,1,0.01,74,78,5,1),(133,'Oscilator quartz LF XTAL003033 IQD','LF-XTAL003033','<div>Industry standard leaded package&nbsp;</div><div>Resistance welded, hermetically sealed in an inert atmosphere,\r\nglass to metal seals on leads&nbsp;</div><div>Standard 2 leg&nbsp;</div><div>HC49 package&nbsp;</div><div>Model HC49&nbsp;</div><div>Model Issue number 15&nbsp;<br></div>','<div><span style=\"font-size: 1rem;\">Frequency Stability ±50.00ppm&nbsp;</span><br></div><div>Operating Temperature Range -10.00 to 60.00°C&nbsp;</div><div>Overtone Order Fundamental&nbsp;</div><div>Ageing ±3ppm typical per year<br></div><div>Shunt Capacitance 7pF max&nbsp;</div><div>Drive Level 1mW max&nbsp;</div><div>ESR 800.00Ω max&nbsp;<br></div>','snap00399.png','2022-06-27 19:42:19.392000','2022-06-27 19:42:19.392000',_binary '',_binary '',1.87,2.75,0,1,1,1,0.01,75,79,0,0),(134,'Rezistor AR02BTCY1000 x 100 buc. VIKING','AR02BTCY1000','<font color=\"#0000ff\"><b>Features</b></font><div><br></div><div>AEC-Q200 Compliance</div><div>Advanced thin film technology</div><div>RoHS compliant</div><div>Special materials, design, and processing</div><div>Test proven immunity to moisture and sulphur</div><div><br></div><div><br></div>','<div><b><font color=\"#ff0000\">Applications:</font></b></div><div><br></div><div><ul><li>Automotive</li><li>Medical equipment</li><li>Testing / measuring equipment</li><li>Printer equipment</li><li>Automatic equipment controller</li><li>Converters</li><li>Communication device, Cell Phone, GPS</li></ul></div>','snap00402.png','2022-06-27 19:47:46.292000','2022-06-27 19:54:16.375000',_binary '',_binary '',3.48,5.12,5,5,6,5,0.1,76,69,4,1),(135,'Rezistor CFR0S2J0104A10 x 100 buc. ROYAL OHM','CFR0S2J0104A10','<div><b><font color=\"#0000ff\">Features</font></b></div><div><b><font color=\"#0000ff\"><br></font></b></div><div><ul><li>Automatically insertable</li><li>High quality performance</li><li>Non-Flame type available</li><li>Cost effective and commonly used</li><li>Too low or too high values can be supplied on case to case basis</li></ul></div>','<div><div>A resistor is a passive two-terminal electrical component that implements electrical resistance as a circuit element. In electronic circuits, resistors are used to reduce current flow, adjust signal levels, to divide voltages, bias active elements, and terminate transmission lines, among other uses. High-power resistors that can dissipate many watts of electrical power as heat may be used as part of motor controls, in power distribution systems, or as test loads for generators. Fixed resistors have resistances that only change slightly with temperature, time or operating voltage. Variable resistors can be used to adjust circuit elements (such as a volume control or a lamp dimmer), or as sensing devices for heat, light, humidity, force, or chemical activity.</div><div><br></div><div>Resistors are common elements of electrical networks and electronic circuits and are ubiquitous in electronic equipment. Practical resistors as discrete components can be composed of various compounds and forms. Resistors are also implemented within integrated circuits.</div><div><br></div><div>The electrical function of a resistor is specified by its resistance: common commercial resistors are manufactured over a range of more than nine orders of magnitude. The nominal value of the resistance falls within the manufacturing tolerance, indicated on the component.</div></div>','snap00409.png','2022-06-27 19:58:17.771000','2022-06-27 20:03:12.229000',_binary '',_binary '',4.1,5.85,0,3,5,5,0.1,77,70,0,0),(136,'Termistor B57153S0100M000 TDK','B57153S0100M000','<div><b><font color=\"#0000ff\">Applications&nbsp;</font></b></div><div>Inrush current limiting, e.g. in switch-mode power\r\nsupplies, soft-start motors&nbsp;<br></div>','<div><b><font color=\"#ff0000\">Features&nbsp;</font></b></div><div>Leaded and coated NTC thermistors&nbsp;</div><div>Tinned copper wire, kinked&nbsp;</div><div>Coating material flame retardant to UL 94 V-0&nbsp;</div><div>Component marking includes the manufacturer\'s\r\nlogo, resistance value and date code&nbsp;</div><div>Highly stable electrical characteristics&nbsp;</div><div><font color=\"#ff0000\"><br></font></div><div><b><font color=\"#ff0000\">Approvals&nbsp;</font></b></div><div>UL 1434 (file number E69802)&nbsp;</div><div>IEC (certificate number 101QA12)&nbsp;</div><div>VDE (certificate number 40038223)&nbsp;</div><div>CQC (0900104539)&nbsp;<br></div>','snap00415.png','2022-06-27 20:08:10.961000','2022-06-27 20:10:19.069000',_binary '',_binary '',1.2,1.85,0,1,1,1,0.01,78,71,5,1),(137,'Potențiometru 14910F0GJSX10101KA VISHAY','14910F0GJSX10101KA','<div><b><font color=\"#0000ff\">FEATURES&nbsp;</font></b></div><div>• Robust construction&nbsp;</div><div>• High rotational life (50 000 cycles)&nbsp;</div><div>• Up to three sections PC support plates&nbsp;</div><div>• Rotary switches and solder lugs terminals available&nbsp;</div><div>• Tests according to CECC 41000 or IEC 60393-1&nbsp;</div><div>• Material categorization: for definitions of compliance\r\nplease see <a href=\"www.vishay.com/doc?99912\" target=\"_blank\">www.vishay.com/doc?99912</a>&nbsp;<br></div>','<div><div>A potentiometer is a three-terminal resistor with a sliding or rotating contact that forms an adjustable voltage divider.[1] If only two terminals are used, one end and the wiper, it acts as a variable resistor or rheostat.</div><div><br></div><div>The measuring instrument called a potentiometer is essentially a voltage divider used for measuring electric potential (voltage); the component is an implementation of the same principle, hence its name.</div><div><br></div><div>Potentiometers are commonly used to control electrical devices such as volume controls on audio equipment. Potentiometers operated by a mechanism can be used as position transducers, for example, in a joystick. Potentiometers are rarely used to directly control significant power (more than a watt), since the power dissipated in the potentiometer would be comparable to the power in the controlled load.</div></div>','snap00417.png','2022-06-27 20:13:39.617000','2022-06-27 20:17:27.216000',_binary '',_binary '',12.4,16.55,5,1,1,1,0.01,79,72,0,0);
