INSERT INTO `reviews` VALUES (59,'Cardul are o capacitate mare (512 GB) și viteza de transfer a datelor este excelentă','Card încăpător',4,'2022-06-01 20:18:32.148000',9,53,1),(60,'A funcționat conform specificațiilor.','Produsul a fost perfect',5,'2022-06-28 20:10:31.571000',39,126,0),(61,'Produsul este bun dar am avut dificultăți la montare pe placa de circuite.','Produsul este bun',4,'2022-06-29 12:37:22.272000',1,134,0),(62,'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.','Supercondensator cu capacitanță mare',5,'2022-07-01 22:35:11.853000',1,132,0),(63,'Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est.','Caracteristici foarte bine documentate',5,'2022-07-02 19:43:50.957000',34,110,0),(64,'Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est.','Nu a funcționat conform specificațiilor',3,'2022-07-02 19:44:24.018000',1,107,0),(65,'Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae.','Produsul a fost destul de rapid',4,'2022-07-02 19:50:35.059000',39,52,0),(66,'Vestibulum nisl sem, mattis at sem ac, elementum rutrum odio. Vivamus tristique lobortis commodo. Ut non malesuada nisl. Praesent dignissim felis in molestie volutpat. Pellentesque eros lectus, facilisis eget auctor eu, lacinia a dolor.','Foarte util și ușor de folosit',5,'2022-07-04 17:55:22.006000',39,111,0),(67,'Curabitur eget lacinia risus, eu lobortis nisl. Nam at tempor nulla, ut aliquet urna. Suspendisse viverra velit vel lectus consectetur, et rutrum nibh ullamcorper.','Conform specificațiilor',5,'2022-07-04 17:56:02.241000',39,136,0),(68,'Produsul este excelent, dar este cam scump. De aceea am oferit 4 stele.','Un condensator bine documentat, dar cam scump',4,'2022-05-04 17:57:54.706000',39,131,3),(69,'Condensatorul tantal produs de Kemet.','Conform specificațiilor. Îl recomand.',5,'2022-06-11 16:58:48.706000',10,131,3),(70,'A corespuns întocmai așteptărilor.','Perfect pentru aplicația mea.',5,'2022-05-18 14:40:49.706000',3,131,2);
