INSERT INTO `settings` VALUES ('COPYRIGHT','(c) 2022 Circuit E-Store','GENERAL'),('CURRENCY_ID','2','CURRENCY'),('CURRENCY_SYMBOL','€','CURRENCY'),('CURRENCY_SYMBOL_POSITION','After price','CURRENCY'),('CUSTOMER_VERIFY_CONTENT','<div style=\"text-align: left;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: left;\"><span style=\"font-size: 1rem;\">Dragă client,</span></div><div style=\"text-align: left;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: left;\"><span style=\"font-size: 1rem;\"><br></span></div><div><i>Te rog accesează link-ul de mai jos pentru verificarea adresei email:</i></div><div><i><br></i></div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href=\"[[URL]]\" target=\"_blank\">LINK DE VERIFICARE</a><div><b><font color=\"#f79646\" face=\"Helvetica\"></font></b></div><div><br></div><div><br></div><div>Mulțumim,</div><div><b>Echipa magazinului Circuit.</b></div>','MAIL_TEMPLATES'),('CUSTOMER_VERIFY_SUBJECT','Vă rugăm să vă confirmați înregistrarea pentru activarea contului de utilizator','MAIL_TEMPLATES'),('DECIMAL_DIGITS','2','CURRENCY'),('DECIMAL_POINT_TYPE','COMMA','CURRENCY'),('MAIL_FROM','circuit.ecom@gmail.com','MAIL_SERVER'),('MAIL_HOST','127.0.0.1','MAIL_SERVER'),('MAIL_PASSWORD','abcd','MAIL_SERVER'),('MAIL_PORT','1025','MAIL_SERVER'),('MAIL_SENDER_NAME','Echipa Circuit','MAIL_SERVER'),('MAIL_USERNAME','circuit.ecom@gmail.com','MAIL_SERVER'),('OPTIONAL','Pentru a utiliza serverul SMTP Gmail și a trimite emailuri la o adresa reală, pentru MAIL_HOST folosește smtp.gmail.com și ambele SMTP_AUTH & SMTP_SECURED trebuie setate pe true. Această implementare folosește Mailhog ca dummy email server. Creare container MailHog: docker run -itd --name mail -p 1025:1025 -p 8025:8025 mailhog/mailhog. Aplicația MailHog poate fi accesată de la: localhost:8025','REGARDING_MAIL'),('ORDER_CONFIRMATION_CONTENT','<b>Dragă [[name]]</b>,&nbsp;<div><br></div><div>Am trimis acest email pentru a confirma că ai plasat o comandă pe site-ul nostru. Te rog să verifici următoarele informații:</div><div><br></div><div>- ID comandă: [[orderId]]</div><div>- Data comenzii: [[orderTime]]</div><div>- Livrare la: [[shippingAddress]]</div><div>- Total: [[total]]</div><div>- Metoda de plată: [[paymentMethod]]</div><div><br></div><div>Comanda este în procesare.</div><div><br></div><div>Îți mulțumim că ai făcut cumpărături în magazinul nostru,</div><div>Echipa magazinului Circuit.</div>','MAIL_TEMPLATES'),('ORDER_CONFIRMATION_SUBJECT','Confimarea comenzii cu ID #[[orderId]]','MAIL_TEMPLATES'),('PAYPAL_API_BASE_URL','https://api-m.sandbox.paypal.com','PAYMENT'),('PAYPAL_API_CLIENT_ID','insert-your-own','PAYMENT'),('PAYPAL_API_CLIENT_SECRET','insert-your-own','PAYMENT'),('SITE_LOGO','site-logo/circuitbrain.png','GENERAL'),('SITE_NAME','Circuit','GENERAL'),('SMTP_AUTH','false','MAIL_SERVER'),('SMTP_SECURED','false','MAIL_SERVER'),('THOUSANDS_POINT_TYPE','WHITESPACE','CURRENCY');
